    [],nt"revision_timestamp": "2016-07-27T22:52:46.023494",nt"name": "swan-river-national-wildlife-refuge-annual-narrative-report-calendar-year-1980",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Swan River
    National Wildlife Refuge outlines Refuge accomplishments during the 1980 calendar
    year. The report begins with an introduction to the Refuge and information about
    climatic and habitat conditions, land acquisition, and the system status. Construction
    and maintenance are also described. Habitat management is covered; grasslands, wetlands,
    and forestlands are discussed. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreation, and violations. Cooperative programs, and items of interest, and safety
    discussed. Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
